import BaseStore from './baseStore'

class PlanStore extends BaseStore {
  constructor () {
    super()
    this.remainingDays = 0

    this.actions = {
      REMAINING_DAYS_RECEIVED: action => {
        this.setRemainingDays(action.data)
      }
    }
  }
  setRemainingDays ({ plan }) {
    this.remainingDays = plan.remaining_days
  }
  getRemainingDays () {
    return this.remainingDays
  }
}

export default PlanStore.getInstance()
